import React, { Component, UseState } from 'react';
import { BrowserRouter as Router, HashRouter, Route, Switch } from 'react-router-dom';
import { GlobalStyle } from './globalStyles';
import Hero from './components/Hero';
import Products from './components/Products/';
import { productData, yearDataTwo } from './components/Products/data';
import ListPage from './components/containers/ListPage';
import Navbar from './components/NavBar/NavBar';
import Footer from './components/Footer/footer';
import { useState , useEffect} from "react";
import InnovYear from './components/InnovYear';
import { yearData } from './components/InnovYear/data';
import Axios from 'axios';

import App from './App';


function Home() {


    const [bestInnov, setBestInnovator] = useState([]);

    const GetBestInnovator = () => {
      console.log('we here at get the best innovator grrrr');
      Axios.get("http://localhost:3000/grrrr").then((response) => {
        console.log(response);
        setBestInnovator(response.data);
      });
    }
  
    // useEffect(() => {
    //   let ignore = false;
    //   if (!ignore)  GetBestInnovator()
    //   return () => { ignore = true; }
    //   },[]);
  

    return (
        <Route>
            <Navbar />
            <Hero />
            <GlobalStyle />
     <button onClick={GetBestInnovator}>Show btt </button>
     {bestInnov.map((val, key ) => {
               return <div> {val.innovator_fname} </div>
              
             })}

            {/* <InnovYear heading='THE INNOVATOR OF THE YEAR' data={bestInnov} /> */}
            {/* <Products heading='THE INNOVATOR OF THE YEAR' data={productData} /> */}
            <Products heading='FEATURED' heading1='INNOVATORS' data={yearDataTwo} />
            {/* <Feature /> */}
            {/* <Route path='/' exact component={Innov} /> */}
            <Footer />
        </Route>


    );
}


export default Home;
